export enum DataFetcher {
  BD = 1,
  WE = 2,
  STD = 3
}

export const getData = (value: DataFetcher) => {
  switch (value) {
    case DataFetcher.BD:
      return {
        location: '',
        internship: {
          category: '',
          skill: ''
        },
        skills: []
      };
    case DataFetcher.WE:
      return {
        desg: '',
        comp: '',
        startY: '',
        startM: '',
        endY: '',
        endM: '',
        desc: ''
      };
    case DataFetcher.STD:
      return {
        univ: '',
        course: '',
        spec: '',
        type: 'Part time',
        startY: '',
        startM: '',
        passY: '',
        passM: '',
        desc: '',
        docs: ''
      };
  }
};

export const imgData =
  'data:image/png;base64,';
